-- title:  Ballad of Ser Dorian
-- author: GR8N8
-- desc:   I ported a song by Ben Reber
-- script: lua
-- song-url: https://soundcloud.com/user-411047148/ser-dorian

music(0)
t=0
x=0
function TIC()
 x=x+t/100000
 if x>200 then
 	x=0
 end
 cls(15)
 map(0,11,29,16,0,98)
	map(0,0,29,8,x,26,15)
	map(0,0,29,8,x-30,30,15)
	map(0,0,29,8,x-100,33,15)
	spr(128,150,50,15,1,0,0,5,8)
	print("Ballad of Ser Dorian",64,20,4)
	t=t+1
end

